import React from 'react';

export const Grounded = () => {
  return (
    <div className='reports'>
      <span>Grounded</span>
    </div>
  );
};

export const Grounded1 = () => {
  return (
    <div className='reports'>
      <h1>grounded/grounded1</h1>
    </div>
  );
};

export const Passed = () => {
  return (
    <div className='reports'>
      <h1>grounded/passed</h1>
    </div>
  );
};

export const Purchased = () => {
  return (
    <div className='reports'>
      <h1>grounded/purchased</h1>
    </div>
  );
};

export const LastChance = () => {
  return (
    <div className='reports'>
      <h1>grounded/lastchance</h1>
    </div>
  );
};
